import React from 'react';

const Banniereaccueil = (props) => {
    return (
        <div className="accueilBann" style={{background : props.background}}>
            <h2 className="bannTitre">
                {props.titre}
            </h2>
            <h4 className="bannSoustitre">
                {props.sousTitre}
            </h4>
            <div className="d-flex justify-content-center w-100">
                <a  className="bannLink">
					Acheter 
                </a>
                <a className="bannLink">
					Voir plus de {props.produit.categorie.nom}
                </a>
            </div>
            <img src={props.image} className="bannImg" />
        </div>
    );
}

export default Banniereaccueil;
